DROP TABLE categoria_tarjeta CASCADE CONSTRAINTS;

DROP TABLE cliente CASCADE CONSTRAINTS;

DROP TABLE empleado CASCADE CONSTRAINTS;

DROP TABLE producto_cliente CASCADE CONSTRAINTS;

DROP TABLE sucursal CASCADE CONSTRAINTS;

DROP TABLE tipo_empleado CASCADE CONSTRAINTS;

CREATE TABLE categoria_tarjeta (
    cat_tarjeta  VARCHAR2(10) NOT NULL,
    descrip_tar  VARCHAR2(100) NOT NULL
);

ALTER TABLE categoria_tarjeta ADD CONSTRAINT categoria_tarjeta_pk PRIMARY KEY ( cat_tarjeta );

CREATE TABLE cliente (
    run_cli           VARCHAR2(10) NOT NULL,
    nom_cli           VARCHAR2(25) NOT NULL,
    apat_cli          VARCHAR2(25) NOT NULL,
    amat_cli          VARCHAR2(25) NOT NULL,
    sueldo_bruto      NUMBER(10) NOT NULL,
    fecha_nacimiento  DATE,
    celular           VARCHAR2(10),
    fono_cel          VARCHAR2(10),
    fecha_ing_banco   DATE,
    cod_emp           VARCHAR2(25) NOT NULL
);

ALTER TABLE cliente ADD CONSTRAINT cliente_pk PRIMARY KEY ( run_cli );

CREATE TABLE empleado (
    cod_emp               VARCHAR2(25) NOT NULL,
    nom_emp               VARCHAR2(25) NOT NULL,
    apat_emp              VARCHAR2(25) NOT NULL,
    amat_emp              VARCHAR2(25) NOT NULL,
    fecha_contrato        DATE,
    sueldo_bruto          NUMBER(10) NOT NULL,
    seguro_obligatorio    NUMBER(3),
    afp                   NUMBER(3),
    salud                 NUMBER(3),
    tpcod_emp             VARCHAR2(10) NOT NULL,
    cod_jefe              VARCHAR2(25),
    sucursal_id_sucursal  NUMBER(5) NOT NULL
);

ALTER TABLE empleado ADD CONSTRAINT empleado_pk PRIMARY KEY ( cod_emp );

CREATE TABLE producto_cliente (
    cat_tarjeta       VARCHAR2(10) NOT NULL,
    run_cli           VARCHAR2(10) NOT NULL,
    fecha_apertura    DATE,
    monto_solicitado  NUMBER(10) NOT NULL,
    estado            VARCHAR2(1)
);

ALTER TABLE producto_cliente ADD CONSTRAINT producto_cliente_pk PRIMARY KEY ( cat_tarjeta,
                                                                              run_cli );

CREATE TABLE sucursal (
    id_sucursal         NUMBER(5) NOT NULL,
    nombre_sucursal     VARCHAR2(50) NOT NULL,
    direccion_sucursal  VARCHAR2(100)
);

ALTER TABLE sucursal ADD CONSTRAINT sucursal_pk PRIMARY KEY ( id_sucursal );

CREATE TABLE tipo_empleado (
    tpcod_emp  VARCHAR2(10) NOT NULL,
    descrip    VARCHAR2(50) NOT NULL
);

ALTER TABLE tipo_empleado ADD CONSTRAINT tipo_empleado_pk PRIMARY KEY ( tpcod_emp );

ALTER TABLE cliente
    ADD CONSTRAINT cli_emp_fk FOREIGN KEY ( cod_emp )
        REFERENCES empleado ( cod_emp );

ALTER TABLE empleado
    ADD CONSTRAINT emp_suc_fk FOREIGN KEY ( sucursal_id_sucursal )
        REFERENCES sucursal ( id_sucursal );

ALTER TABLE empleado
    ADD CONSTRAINT emp_tipo_emp_fk FOREIGN KEY ( tpcod_emp )
        REFERENCES tipo_empleado ( tpcod_emp );

ALTER TABLE empleado
    ADD CONSTRAINT jefe_empleado FOREIGN KEY ( cod_jefe )
        REFERENCES empleado ( cod_emp );

ALTER TABLE producto_cliente
    ADD CONSTRAINT pro_cli_cat_tar_fk FOREIGN KEY ( cat_tarjeta )
        REFERENCES categoria_tarjeta ( cat_tarjeta );

ALTER TABLE producto_cliente
    ADD CONSTRAINT pro_cli_cli_fk FOREIGN KEY ( run_cli )
        REFERENCES cliente ( run_cli );








COMMIT;
